local height = platform.window:height() --212
local width = platform.window:width() --318

local birdState = 0
local birdHeight = 100
local groundCounter = 0
local gameState = 0 --0 = start, 1 = play, 2 = score

local pipes = {}
pipes[0] = physics.Vect(width + 12, math.random(44, 128))
local numbers = {zero, one, two, three, four, five, six, seven, eight, nine}
local dead = false
local score = 0

--physics variables
local space = physics.Space()
space:setGravity(physics.Vect(0, 1500))

local bird = physics.Body(150, physics.misc.momentForBox(80, 16, 12))
bird:setPos(physics.Vect(35, birdHeight))
bird:setVLimit(300)

space:addBody(bird)
--</physics variables>
function on.paint(gc) --basically the main loop

	--at 30fps
	timer.start(0.033)
		
	--------------------------------------------------------------------------------------

	--update bird state (always)
	birdState = birdState + 1;
	if birdState == 3 then
		birdState = 0
	end
	
	--update ground counter (always)
	groundCounter = groundCounter + 1
	if groundCounter == 5 then
		groundCounter = 0
	end
	
	if gameState == 1 then --playing
		--update pipe location
		for i = getPipeStartingNum(), table.getn(pipes) do
			pipes[i]:setx(pipes[i]:x() - 4)
		end

		if pipes[table.getn(pipes)]:x() < 256 then
			pipes[table.getn(pipes) + 1] = physics.Vect(width + 12, math.random(44, 128))
		end
	
		--if bird collides with pipe
		birdBB = physics.BB(27, bird:pos():y() - 6, 43, bird:pos():y() + 6)
		for i = getPipeStartingNum(), table.getn(pipes) do
			pipeUpBB = physics.BB(pipes[i]:x() - 12, pipes[i]:y() - 191.5, pipes[i]:x() + 12, pipes[i]:y() - 21.5)
			pipeDownBB = physics.BB(pipes[i]:x() - 12, pipes[i]:y() + 21.5, pipes[i]:x() + 12, pipes[i]:x() + 191.5)
			if pipeUpBB:intersects(birdBB) or pipeDownBB:intersects(birdBB) then
				dead = true
			end
		end
		--if bird hits the ground
		if bird:pos():y() >= 165 then
			dead = true
		end
		
		--update score
		birdVect = physics.Vect(35, bird:pos():y())
		pipeBB = physics.BB(pipes[score]:x() - 12, pipes[score]:y() - 191.5, pipes[score]:x() + 12, pipes[score]:y() + 191.5)
		if pipeBB:containsVect(birdVect) then
			score = score + 1
		end	
		
		if dead then
			gameState = 2
			reload()
		end
		space:step(0.033)	
	end --end playing section						
	--------------------------------------------------------------------------------------
	
	--draw the stuff--
	gc:drawImage(background, 0, 0) --(always)
	drawBird(birdState, gc) --bird (always)
	if gameState == 1 then
		for i = getPipeStartingNum(), table.getn(pipes) do --pipes (gs = 1)
			if pipes[i]:x() >= -12 then
				drawPipes(pipes[i]:x(), pipes[i]:y(), gc)
			end
		end
		drawNumbers(score, 27, gc) --score (gs = 1)
	end
	gc:drawImage(ground, -(4 * groundCounter), height - 41) --ground (always)
	if gameState == 0 then
		gc:drawImage(logo, (width / 2) - 78, 69)
		gc:drawImage(directions, (width / 2) - 44, 108)
		local credit = "Recreated by: Peter Menke"
		gc:setFont("sansserif", "r", 8)
		gc:drawString(credit, 0, height)
	end
	if gameState == 2 then
		gc:drawImage(gameOver, (width / 2) - 90, 50)
		drawNumbers(score, 100, gc)
		gc:drawImage(playAgain, (width / 2) - 44, 134)
	end
end

function drawBird(state, gc)
	local tex
	if state == 0 then
		tex = bird1
	elseif state == 1 then
		tex = bird2
	elseif state == 2 then
		tex = bird3
	end
	--draw the bird
	gc:drawImage(tex, 35, bird:pos():y() - 6)
end

function drawPipes(ex, why, gc)
	--draw bottom pipe
	gc:drawImage(pipe, ex - 12, why + 21.5)
	--draw upper pipe
	gc:drawImage(pipeFlip, ex - 12, (why - 21.5) - image.height(pipe))
end


function drawNumbers(num, why, gc) --dont ask how this works, i dont know
	local str = num .. ""
	local length = str:len()
	
	if (str:len() % 2) == 0 then --even
		for i = 1, length / 2 do --left side
			gc:drawImage(numbers[tonumber(str:sub(((length / 2) + 1) - i, ((length / 2) + 1) - i)) + 1], (width / 2) - (10 * i), why)
		end
		for i = (length / 2) + 1, length do --right side
			gc:drawImage(numbers[tonumber(str:sub(i, i)) + 1], (width / 2) + (10 * (i - (length / 2) - 1)), why)
		end
	else --odd
		for i = 1, math.floor(length / 2) do --left side
			gc:drawImage(numbers[tonumber(str:sub(math.ceil(length / 2) - i, math.ceil(length / 2) - i)) + 1], (width / 2) - (10 * i) - 5.5, why)
		end
		for i = math.ceil(length / 2) + 1, length do --right side
			gc:drawImage(numbers[tonumber(str:sub(i, i)) + 1], (width / 2) + (10 * (i - math.ceil(length / 2) - 1)) + 5.5, why)
		end
		gc:drawImage(numbers[tonumber(str:sub(math.ceil(length / 2), math.ceil(length / 2))) + 1], (width / 2) - 5.5, why)
	end
end

function getPipeStartingNum()
	if table.getn(pipes) < 6 then
		return 0
	else
		return table.getn(pipes) - 6
	end
end

function on.timer()
	platform.window:invalidate()
end

function on.enterKey()
	if gameState == 0 then
		gameState = 1
	end
	if gameState == 1 then
		if bird:pos():y() >= 0 then
			bird:setVel(physics.Vect(0, 0))
			bird:applyImpulse(physics.Vect(0, -28000), physics.Vect(0, 0))
		end
	end
	if gameState == 2 then
		score = 0
		gameState = 1
	end
end

function reload()
	bird:setPos(physics.Vect(35, birdHeight))
	bird:setVel(physics.Vect(0, 0))
	bird:applyImpulse(physics.Vect(0, -28000), physics.Vect(0, 0))
	pipes = {}
	pipes[0] = physics.Vect(width + 12, math.random(44, 128))
	dead = false
end
